import '../logo192.png'
const cards = [
    {
        name: 'first',
        title:'Первый видос',
    },
    {
        name: 'Second',
        title:'Второй видос',
    },
    {
        name: 'Third',
        title:'Третий видос',
    },
    {
        name: 'Fourth',
        title:'Четвёртый видос',
    }
];
export function Card (){
    return(
    <>
        {cards.map(card => {
        return(
        <div class='card'>
            <p>{card.name}</p>
            <p>{card.title}</p>     
        </div>)
        })}
    </>
    )
}
